import React, { useEffect, useState } from 'react';
import './styles.css';

export default function DocumentForm() {
  const [formInfo, setFormInfo] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const slug = 'usa_passport'; // The slug for the USA Passport document
    fetch(`/api/integration/generator-full-information/${slug}`)
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then(data => {
        setFormInfo(data);
        setIsLoading(false);
      })
      .catch(error => {
        console.error('Error fetching document info:', error);
        setError(error.message);
        setIsLoading(false);
      });
  }, []);

  if (isLoading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  // Function to render form fields based on the API response
  const renderFormFields = (fields) => {
    return fields.map(field => (
      <div key={field.id}>
        <label>{field.input_label}</label>
        <input type={field.type} name={field.input_name} defaultValue={field.value} required={field.required} />
      </div>
    ));
  };

  return (
    <div className="form-container">
      <h2>{formInfo.name}</h2>
      {formInfo.steps.map(step => (
        <div key={step.id}>
          <h3>{step.name}</h3>
          {renderFormFields(step.fields)}
        </div>
      ))}
    </div>
  );
}
